  \"2016-03-17T20:52:02.305834\",\n\t\"name\": \"iowa-motor-fuel-sales-by-county-and-year\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset provides total non-ethanol
  gasoline gallons, ethanol blends E10-E85, diesel, and biodiesel gallons sold by
  county for all retail locations that completed the Retailers Motor Fuel Gallons
  Annual Report.  The State of Iowa has a goal to replace 25 percent of petroleum
  in Iowa with biofuel by 2020. The biofuel distribution percentage measures how the
  state is doing toward meeting that goal. The formula for determining the biofuel
  distribution percentage is as follows:  Biofuel Distribution Percentage = (Pure
  Ethanol Gallons + Pure Biodiesel Gallons) / Total Gasoline Gallons .\",\n\t\"license_title\":
